INSERT INTO `service` VALUES (2,'Disques','Remplacement du syst├¿me de freinage\r\n\r\nRemplacement disques et plaquettes de freins avant et arri├¿re (m├óchoires et tambours)\r\nRemplacement liquide de frein\r\nCanalisation des freins et flexibles\r\nPurge des freins','',0,0,'plaquettes-and-freins-64b6e5371afc9591637243.jpg',82720,'2023-07-18 21:17:11'),(3,'Vidange/entretien','Pour pr├®server votre moteur\r\n\r\nPendant le remplacement de lÔÇÖhuile moteur, v├®rification gratuite sur la vidange et les filtres, le liquide de direction assist├®e, la vidange bo├«te de vitesse manuelle et automatique, le remplacement du liquide de refroidissement / antigel.','',0,0,'vidange-and-entretien-64b6e5605ed4d100910004.jpg',111032,'2023-07-18 21:17:52'),(4,'Boite de vitesse','Remplacement de la boite de vitesse\r\n\r\nVidange bo├«te de vitesse manuelle et automatique, remplacement volant moteur, remplacement kit dÔÇÖembrayage, remplacement de la transmission et soufflet de transmission, r├®paration de la bo├«te de vitesse.','',0,0,'boite-de-vitesse-64b6e5963e71a230779048.jpg',116054,'2023-07-18 21:18:46'),(5,'Echappement','Remplacement et r├®paration du syst├¿me dÔÇÖ├®chappement \r\n\r\nRemplacement ou r├®paration du pot dÔÇÖ├®chappement, remplacement ou r├®paration du silencieux, nettoyage du syst├¿me dÔÇÖ├®chappement, remplacement additifs FAP, changement de vanne EGR.','',0,0,'echappement-64b6e6e335259335370058.jpg',87453,'2023-07-18 21:24:19'),(6,'Diagnostic auto','En cas de panne ├®lectrique \r\n\r\nNous prenons en charge le diagnostic sur tous les v├®hicules. Une lecture des codes d├®fauts de vos calculateurs, un effacement des codes d├®fauts sporadiques, diagnostic ├®lectronique, ├®dition dÔÇÖun bilan complet, explication des anomalies trouv├®es.','',0,0,'diagnostique-64b6e8ee681ef528885321.jpg',59477,'2023-07-18 21:33:02'),(7,'Pneus et roues','Vos pneus sont endommag├®s ? \r\n\r\nNos ├®quipes vous accueillent pour la r├®paration ou le remplacement de vos pneumatiques, toute marque de v├®hicule comprise. Nous changeons dans les meilleurs d├®lais les pneus lisses ou endommag├®s. \r\nFaites-nous confiance pour une exp├®rience de conduite en toute tranquillit├®.','',0,0,'changement-roue-64ceac7aca88d869264904.jpg',47381,'2023-08-05 22:09:30'),(8,'R├®parations int├®rieures','Les r├®parations dÔÇÖint├®rieurs permettent de r├®parer tous les dommages que peut subir lÔÇÖhabitacle dÔÇÖun v├®hicule :\r\n- rayures, trous, griffes diverses, usure pr├®matur├®e des si├¿ges cuirs, brulures de cigarettes etc...\r\nElles permettent de garder lÔÇÖint├®rieur du v├®hicule impeccable mais aussi et surtout de le valoriser lors dÔÇÖune vente.','',0,0,'interieurvoiture-64ef9d1833818335280232.jpg',33800,'2023-08-30 21:48:40');
